	bbsNoticeF.onmouseout  = new Function("if(!bbsNoticeO){bbsNoticeO = setTimeout('bbsNoticePlay()',4000);bbsNoticeH=true;}");
}
function bbsNoticePlay() {
	if (bbsNoticeC.scrollHeight <= 35) {
		bbsNoticeO = setTimeout('bbsNoticePlay()',4000);
		bbsNoticeF.scrollTop = bbsNoticeC.scrollTop = 0;
		bbsNoticeH = true;
		return ;
	}
	if (bbsNoticeH) {
		bbsNoticeF.scrollTop = 35;
		if (bbsNoticeC.scrollHeight-37 <= bbsNoticeC.scrollTop) {
			bbsNoticeC.scrollTop = 0;
		} else {
			bbsNoticeC.scrollTop += 37;
		}
		bbsNoticeH = false;
		bbsNoticeO = setTimeout('bbsNoticePlay()',500);
	} else {
		bbsNoticeF.scrollTop = 0;
		bbsNoticeH = true;
		bbsNoticeO = setTimeout('bbsNoticePlay()',4000);
	}
}
var bbsNoticeF = bbsNoticeC = null;
var bbsNoticeH = true;
var bbsNoticeO = 0;
bbsNoticeLoad();
